import React from 'react';
import styled from "styled-components";
import {Title} from "../../styles/common";

const StyledLogo = styled.a`
  display: flex;
  align-items: center;
  font-size: 2.11111rem;
  font-weight: 700;
  gap: 0.46rem;
`

function Logo() {
  return (
    <StyledLogo href="/">
      <img src="./img/common/logo.svg" alt="Logo"/>
      <div>Organick</div>
    </StyledLogo>
  );
}

export default Logo;
